import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faS } from "@fortawesome/free-solid-svg-icons";
function Box({icon, content}){
    return(
        <div className="box">
            <FontAwesomeIcon icon={[faS, ]}/>
            <p>{content}</p>
        </div>
    )
}

export default Box;
